import React, {useState} from 'react';

import './TypeaheadResults.css';

const TypeaheadResults = (props) => {

    console.log(props.id);
    return(
       <div key={props.id}>
            <img></img>
            <span>{props.name}</span>
        </div>
    );
}

export default TypeaheadResults;
